import {IoLogoFacebook, IoLogoGithub, IoLogoInstagram, IoLogoLinkedin} from "react-icons/io";
import "./NavBar.scss";

const Footer = () => {
  return (
    <footer>
      <div>
        <h3>John Y.</h3>
        <ul>
          <li>
            <IoLogoFacebook />
          </li>
          <li>
            <IoLogoInstagram />
          </li>
          <li>
            <IoLogoLinkedin />
          </li>
          <li>
            <IoLogoGithub />
          </li>
        </ul>
      </div>
    </footer>
  );
};

export default Footer;
